弾けるポップコーンに、みんなでワクワク♪味付けによって色々楽しめます。アツアツを召し上がれ!!<table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">弾けるポップコーンに、みんなでワクワク♪味付けによって色々楽しめます。アツアツを召し上がれ!!</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">約13.0×18.0×27.0cm</font><br><font color="#333333" size="-1">個装サイズ：19×13×28cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">約660g</font><br><font color="#333333" size="-1">個装重量：800g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">本体:ポリプロピレン<br>カバー:AS樹脂</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">100V-800W<br>コード長:約1.4m<br>食洗機不可</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">付属品</font></td><td align="left"><font color="#333333" size="-1">保証書(1年)、取扱説明書</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">中国</font></td></tr></table><br><font color="#333333" size="-1">販売会社/広告文責<br>株式会社Hanbit<br>Tel 050-1040-7307</font><style type="text/css">
